import './App.css';
import React from "react";

import Homepage from './components/Homepage.jsx';
import Dashboard from './components/Dashboard.jsx';
import Register from './components/Register.jsx';
import Login from './components/Login.jsx';
import Logout from './components/Logout.jsx';
import DeleteAccount from './components/DeleteAccount.jsx';
import Feed from './components/Feed.jsx';
import ForgotPassword from './components/ForgotPassword.jsx';
import Reset from './components/Reset.jsx';
import SetupAccount from './components/SetupAccount.jsx';
import AddMedia from './components/AddMediaModal';
import TestingDeleteAccount from './components/TestingDeleteAccount.jsx'



import { BrowserRouter, Route, Routes } from "react-router-dom";


function App() {
  console.log(process.env.REACT_APP_BASE_URL, "url base <--")
  return (
    <div className="App">
      <header className="App-header">
      </header>
        <BrowserRouter basename={process.env.REACT_APP_BASE_URL}>
        <Routes>

          <Route path="/dashboard" element={<Dashboard />} />

          <Route path="/setup-account" element={<SetupAccount />} />
          <Route path="/reset" element={<Reset />} />
          <Route path="/forgot" element={<ForgotPassword />} />
          <Route path="/login" element={<Login />} />
          <Route path="/logout" element={<Logout />} />
          <Route path="/register" element={<Register />} />
          <Route path="/delete" element={<DeleteAccount />} />
          <Route path="/testing-will" element={<TestingDeleteAccount />} />
          <Route path="/feed" element={<Feed />} />
          <Route path="/add-media" element={<AddMedia />} />
          <Route path="/" element={<Homepage />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
